def open_encrypt():
    new = Toplevel(root)
    new.geometry("560x250")
    new.title("Encryption Folder")

    def browseFolder():
        folder_path = filedialog.askdirectory()
        folder_path_entry.delete(0, END)
        folder_path_entry.insert(0, folder_path)

    def encrypt_folder():
        folder_path = folder_path_entry.get()
        sender_mail = sender_mail_entry.get()
        smtp_password = smtp_password_entry.get()
        receiver_mail = receiver_mail_entry.get()

        if folder_path == '':
          messagebox.showerror("Error", "Please select a folder to encrypt.")
          return

        if not os.path.exists(folder_path):
          messagebox.showerror("Error", "Invalid folder path.")
          return

        if not sender_mail or not smtp_password or not receiver_mail:
          messagebox.showerror("Error", "Please fill all fields.")
          return

        key = Fernet.generate_key()
        fernet = Fernet(key)

        for filename in os.listdir(folder_path):
          filepath = os.path.join(folder_path, filename)
          if os.path.isfile(filepath):
            with open(filepath, 'rb') as file:
              data = file.read()
              encrypted = fernet.encrypt(data)
            with open(filepath, 'wb') as file:
              file.write(encrypted)

        # Send the decryption key to the receiver's email
        subject = 'Encryption Key for Folder'
        message = f"The key for Encrypted folder is: {key.decode()}"

        smtp_server = "smtp.gmail.com"
        smtp_port = 587

        msg = MIMEMultipart()
        msg['From'] = sender_mail
        msg['To'] = receiver_mail
        msg['Subject'] = subject

        msg.attach(MIMEText(message, 'plain'))

        server = smtplib.SMTP(smtp_server, smtp_port)
        server.starttls()

        server.login(sender_mail, smtp_password)
        server.sendmail(sender_mail, receiver_mail, msg.as_string())
        server.quit()

        messagebox.showinfo("Info", "Folder encrypted successfully. Encryption key sent to the receiver mail.")

    folder_path_label = Label(new, text="Folder Path")
    folder_path_entry = Entry(new, width=60)
    browse_button = Button(new, text="Browse Folder", command=browseFolder)

    sender_mail_label = Label(new, text="Sender Mail")
    sender_mail_entry = Entry(new, width=60)

    smtp_password_label = Label(new, text="SMTP Password")
    smtp_password_entry = Entry(new, width=60, show='*')

    receiver_mail_label = Label(new, text="Receiver Mail")
    receiver_mail_entry = Entry(new, width=60)

    encrypt_button = Button(new, text="ENCRYPT", font=("bold", 12), padx=10, pady=5, fg="white", bg="grey",command=encrypt_folder)

    folder_path_label.grid(row=0, column=0, sticky=E)
    folder_path_entry.grid(row=0, column=1, columnspan=2)
    browse_button.grid(row=0, column=2)

    sender_mail_label.grid(row=1, column=0, sticky=E)
    sender_mail_entry.grid(row=1, column=1, columnspan=2)

    smtp_password_label.grid(row=2, column=0, sticky=E)
    smtp_password_entry.grid(row=2, column=1, columnspan=2)

    receiver_mail_label.grid(row=3, column=0, sticky=E)
    receiver_mail_entry.grid(row=3, column=1, columnspan=2)

    encrypt_button.grid(row=4, column=1)

    new.grid_rowconfigure(0, weight=0)
    new.grid_columnconfigure(1, weight=10)

    folder_path_label.grid(padx=10, pady=5, sticky="e")
    folder_path_entry.grid(padx=10, pady=5, sticky="w")
    browse_button.grid(padx=10, pady=5, sticky="w")

    sender_mail_label.grid(padx=10, pady=5, sticky="e")
    sender_mail_entry.grid(padx=10, pady=5, sticky="w")

    smtp_password_label.grid(padx=10, pady=5, sticky="e")
    smtp_password_entry.grid(padx=10, pady=5, sticky="w")

    receiver_mail_label.grid(padx=10, pady=5, sticky="e")
    receiver_mail_entry.grid(padx=10, pady=5, sticky="w")

    encrypt_button.grid(padx=100, pady=10)

    new.grab_set()


def open_decrypt():
    new = Toplevel(root)
    new.geometry("560x200")
    new.title("Decryption Folder")

    def browseFolder():
        folder_path = filedialog.askdirectory()
        folder_path_entry.delete(0, END)
        folder_path_entry.insert(0, folder_path)

    def decrypt_folder():
        folder_path = folder_path_entry.get()
        key = key_entry.get()

        if folder_path == '':
            messagebox.showerror("Error", "Please select a folder to decrypt.")
            return

        if key == '':
            messagebox.showerror("Error", "Please enter the decryption key.")
            return

        try:
            key = bytes(key.encode())
            fernet = Fernet(key)

            for filename in os.listdir(folder_path):
                filepath = os.path.join(folder_path, filename)
                if os.path.isfile(filepath):
                    with open(filepath, 'rb') as file:
                        data = file.read()
                    decrypted = fernet.decrypt(data)

                    with open(filepath, 'wb') as file:
                        file.write(decrypted)

            messagebox.showinfo("Info", "Folder decrypted successfully.")
        except Exception as e:
            messagebox.showerror("Error", f"Error during decryption: {str(e)}")

    folder_path_label = Label(new, text="Folder Path")
    folder_path_entry = Entry(new, width=60)
    browse_button = Button(new, text="Browse Folder", command=browseFolder)

    key_label = Label(new, text="Decryption Key")
    key_entry = Entry(new, width=60, show='*')

    decrypt_button = Button(new, text="DECRYPT",font=("bold", 12), padx=10, pady=5, fg="white", bg="grey", command=decrypt_folder)

    folder_path_label.grid(row=0, column=0, sticky=E)
    folder_path_entry.grid(row=0, column=1, columnspan=2)
    browse_button.grid(row=0, column=2)

    key_label.grid(row=1, column=0, sticky=E)
    key_entry.grid(row=1, column=1, columnspan=2)

    decrypt_button.grid(row=2, column=1)

    new.grid_rowconfigure(0, weight=0)
    new.grid_columnconfigure(1, weight=10)

    folder_path_label.grid(padx=10, pady=5, sticky="e")
    folder_path_entry.grid(padx=10, pady=5, sticky="w")
    browse_button.grid(padx=10, pady=5, sticky="w")

    key_label.grid(padx=10, pady=5, sticky="e")
    key_entry.grid(padx=10, pady=5, sticky="w")

    decrypt_button.grid(padx=100, pady=10)

    new.grab_set()   

